import Navbar from "../Components/Navbar";
import Footer from "../Components/Footer";

import alphard from "../image/mobil/alphard.webp";

export default function DetailMobil() {
    return (
        <>
            <Navbar />
            <div className="container w-100 h-auto my-40 mx-auto rounded-2xl p-20 bg-[#F4F6F5]">
                <h1 className="font-black text-4xl text-left mb-10">
                    DETAIL PENYEWAAN
                </h1>
                <div className="w-1/2 flex justify-between lg:flex-row flex-col">
                    <div className="w-100 lg:mx-4">
                        <img className=" rounded-3xl" src={alphard} alt="" />
                    </div>
                    <div className="w-1/2 lg:mx-4">
                        <h1 className="font-black w-100 text-2xl text-left">
                            Alphard
                        </h1>
                    </div>
                </div>
            </div>
            <Footer />
        </>
    );
}
